import React from "react";
import Link from "./Link";
import Card from "./Card";


const favSeries = "";


const FavS = ()=> {
if (favSeries === "netflix") {
    return(
      <Card key={Link[1].id}
        sname ={Link[1].sname} 
        imgsrc ={Link[1].imgsrc} 
        title={Link[1].title} 
        link ={Link[1].links} 
         />
      );
    }

      else{
        return(
            <Card key={Link[0].id}
              sname ={Link[0].sname} 
              imgsrc ={Link[0].imgsrc} 
              title={Link[0].title} 
              link ={Link[0].links} 
               />
            );
      }
    };

const App =()=> (
<>
<h1 className="heading_style">This is Heading </h1>
<FavS />
</> 
);
export default App;
